  const [elementData, setElementData] = useState({
    title: "",
    question: "",
    correctAnswer: "",
    answer1: "",
    answer2: "",
    answer3: "",
  });

  return (
    <div className="newQuizContent">
      <NewQuizButtons />
      <NewQuizinput setElementData={setElementData}/>
      <NewQuizScrolbar />
    </div>
  );
}

export default NewQuiz;
